sys_variable_value.value:
(function execute(inputs, outputs) {

    outputs.matches = inputs.books.length;
    const firstBook = inputs.books[0];
    outputs.first_book_id = firstBook["id"];
    outputs.first_book_title = firstBook["title"];
    outputs.first_book_author = firstBook["author"];

})(inputs, outputs);

